特点：1、类是引用类型，实例化变量的本质是声明一个指向该地址的名称而已，可以修改该地址的可变类型的成员变量的值，但是不可以再次给储存该地址的变量赋于一个新的地址。
     2、枚举和结构体是值类型。在枚举和结构体内部的函数中是不可以修改自己本身的值，因此需要在函数前加一个“mutating”修饰。
     3、===用于比较2个引用类型的变量是否指向同一个地址
        ==用于比较2个值是否相等。
     4、结构体比类更加轻量级，结构体存储在栈中，类存储于堆中。

