//栈:后进先出
struct Stack{
    var items = [T]()
    func isEmpty() -> Bool{
        return items.count == 0
    }

    mutating func push(item:T){
        items.append(item)
    }


    mutating func pop()->T?{
        guard !self.isEmpty() else {
            return nil
        }

        return items.removeLast()
    }
}

extension Stack{
    func top() -> T? {
        return self.items.last
    }
}

