MRC模式下的Setter方法
完美setter方法：判断新旧对象是否是同一个对象，如果是同一个则什么都不做。
只有新旧对象不是同一个对象的时候，才release旧对象retain新对象
同时在对象dealloc的时候也要将属性release掉
-(void)setAAA:(AAA *)aaa{
    if(_aaa != aaa){
        [_aaa release];
        _aaa = [aaa retain];
    }
}


-(void)dealloc{
    [_aaa release];
    [super dealloc];
}

chapter1/20class4e0e23-import-de-qu-bie..body:
@class #import

使用场景：当2个类互相包含的时候，当Person.h中包含Car.h，而Car.h包含Person.h的时候，就会出现循环引用的问题，就会造成无限递归的问题，从而导致无法编译通过
解决方案：向任一一个类中不要使用#import方法引入对方的头文件。而是使用@class 类名; 的方式来标注这个是类，这样子就可以在不引入对方头文件的情况下告诉编译器这个是类

@class与#import的区别

#import是将指定的文件内容拷贝到写指令的地方

@class并不会拷贝任何内容，只是告诉编译器这个1个类，这样编译器在编译的时候才知道这个是1个类

chapter1/22arc.html.body:
ARC

ARC机制下当2个对象互相引用的时候如果2边都使用strong，那么就会造成内存泄漏  

解决方案：一端使用strong，另一端使用weak


ARC机制下如果属性的类型是OC对象类型绝大多数情况使用strong。

在ARC机制下，如果属性的类型不是OC对象，使用assign

strong 和weak都是应用在属性的类型是OC对象的情况下，属性的类型不是OC对象则使用assign。

在ARC机制下将MRC下的retain转换为ARC的strong

@property (nonmatic ,strong ) Car *car;代表生成的私有属性是1个强类型

@property (nonmatic ,weak ) Car *car;代表生成的私有属性是1个弱类型

如果 对属性不写strong 和weak中的任一属性，默认就是strong（强类型）

ARC机制下对象什么时候被回收？

指向对象的指针被回收

指向对象的指针被赋值为nil

对象被回收的表象：没有1个强指针指向这个对象

对象被回收的本质：对象的引用计数器为0



ARC机制下不能将创建的对象用1个弱指针去存储这个对象的地址。（一初始化马上就被释放掉）

强指针：默认情况下我们声明的指针就是1个强指针，或者使用__strong 来显式声明的指针

弱指针：使用__weak修饰的指针


ARC可能遇到的问题

现状：你在ARC机制下写工程项目，但是你需要用到一个类（前人大牛留下的），但是这个类是一个MRC模式的类

解决办法：在Xcode中找到项目对应的“TARGETS”，选择“Build Phases”下的“Compiles Sources”，找到需要将文件设置为支持“ARC”做法为，在文件后面点击添加“-fobjc-arc”

将文件设置为不支持ARC，在文件后面点击添加“-fno-objc-arc”


