Block作为方法返回值
当Block作为返回值的时候，必须使用typedef来将Block数据类型起别名（Xcode不认识这种数据类型）
void(^)() test(){
    OurBlock block = ^{
        NSLog(@"你好");
    };
    return block;
}
typedef void(^OurBlock)();
OurBlock test(){
    OurBlock block = ^{
        NSLog(@"你好");
    };
    return block;
}

Block与函数

相同点：都是封装1段代码
不同点
Block是一个数据类型，函数是1个函数
我们可以声明Block类型的变量，而不能声明函数类型的函数
Block可以作为函数的参数和返回值（因为Block是一种数据类型）

chapter1/32protocol-4e0029.html.body:
协议-Protocol

作用：专门声明一大堆方法，或者属性@property (不能声明属性，也不能实现方法，只能用来写方法的声明)
只要遵循了该协议，那么相当于拥有了这个协议中所有的方法声明
虽然不能声明属性，但是可以声明@property，但是协议不会自动生成私有属性（下划线开头的实例变量_xxx），只会生成setter getter的声明但是不会生成setter getter的实现，因此如果遵循该协议的类要利用这些属性，那么必须自己实现协议中属性的setter getter方法
协议的声明

@protocol 协议名称

//方法的声明

@end

协议文件的新建：New File->Objective-C File ->Protocol 
协议的文件名： .h 并且只有一个.h文件
类遵循协议：如果想要一个类拥有协议中所有的方法声明，那么就让这个类遵循这个协议

@interface 类名:父类名

@end
