UIApplication Delegate

很多原因会导致App受到干扰（打电话、内存不足），当App受到干扰时会产生一些系统事件。这时UIApplication会通知它的Delegate对象，让delegate代理来处理这些系统事件

delegate事件包括：

应用程序的生命周期（程序启动关闭）

系统事件（来电话）

内存警告




UIApplication何时创建

我们都知道应用程序的主入口在main函数中，所以我们对main函数一探究竟

int main(int argc, char * argv[]) {
    @autoreleasepool {
        return UIApplicationMain(argc, argv, @"UIApplication",@"AppDelegate");
    }
}

UIApplicationMain方法好像没见过哎。怎么办？查看Apple的官方文档：Help->Documentation and API Reference

参数说明

principalClassName:String?,_ delegateClassName:String?) -> Int32





principalClassName（程序的主要类）
UIApplication类名或者子类的名称。 nil  或者 @"UIApplication"




principalClassName（代理类）
UIApplication的代理或者代理对象的名称



官方解释
This function instantiates the application object from the principal class and instantiates the delegate (if any) from the given class and sets the delegate for the application. It also sets up the main event loop, including the application’s run loop, and begins processing events. If the application’sInfo.plistfile specifies a main nib file to be loaded, by including theNSMainNibFilekey and a valid nib file name for the value, this function loads that nib file.
Despite the declared return type, this function never returns. For more information on how this function behaves, see “Expected App Behaviors” inApp Programming Guide for iOS.This function instantiates the application object from the principal class and instantiates the delegate (if any) from the given class and sets the delegate for the application. It also sets up the main event loop, including the application’s run loop, and begins processing events. If the application’sInfo.plistfile specifies a main nib file to be loaded, by including theNSMainNibFilekey and a valid nib file name for the value, this function loads that nib file.
Despite the declared return type, this function never returns. For more information on how this function behaves, see “Expected App Behaviors” inApp Programming Guide for iOS.、

