MainStoryBoard设置过，为什么程序启动过就可以看到一个界面？
MainStoryBoard 如果在info.plist设置过，iOS会默认创建一个UIWindow对象，然后初始化一个控制器。然后将控制器赋值给UIWindow对象的根控制器，然后将窗口显示出来

