结论

ARC:控制器view的生命周期调用顺序：viewDidLoad->viewWillAppear->viewWillLayoutSubview->viewDidLayoutSubviews->viewDidAppear->viewWillDisappear->viewDidDisappear
在非ARC模式下view的生命周期还会有2个方法
viewWillUnload：控制器的view将要销毁
viewDidUnload：控制器的view已经销毁：释放一些资源，晴空一些没必要的数据

